import Files from "./Files";

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: "1px solid #DDD"
};

const Layout = props => (
  <div style={layoutStyle}>
    {props.children}
    <Files />
  </div>
);

export default Layout;
